// SPDX-License-Identifier: GPL-3.0-only
pragma solidity >=0.7.6;
pragma abicoder v2;

import "../utils/GsnTypes.sol";
import "../interfaces/IRelayRecipient.sol";
import "../forwarder/IForwarder.sol";

import "./GsnUtils.sol";

/**
 * Bridge Library to map GSN RelayRequest into a call of a Forwarder
 */
library GsnEip712Library {
    // maximum length of return value/revert reason for 'execute' method. Will truncate result if exceeded.
    uint256 private constant MAX_RETURN_SIZE = 1024;

    //copied from Forwarder (can't reference string constants even from another library)
    string public constant GENERIC_PARAMS =
        "address from,address to,uint256 value,uint256 gas,uint256 nonce,bytes data,uint256 validUntil";

    bytes public constant RELAYDATA_TYPE =
        "RelayData(uint256 gasPrice,uint256 pctRelayFee,uint256 baseRelayFee,address relayWorker,address paymaster,address forwarder,bytes paymasterData,uint256 clientId)";

    string public constant RELAY_REQUEST_NAME = "RelayRequest";
    string public constant RELAY_REQUEST_SUFFIX =
        string(abi.encodePacked("RelayData relayData)", RELAYDATA_TYPE));

    bytes public constant RELAY_REQUEST_TYPE =
        abi.encodePacked(
            RELAY_REQUEST_NAME,
            "(",
            GENERIC_PARAMS,
            ",",
            RELAY_REQUEST_SUFFIX
        );

    bytes32 public constant RELAYDATA_TYPEHASH = keccak256(RELAYDATA_TYPE);
    bytes32 public constant RELAY_REQUEST_TYPEHASH =
        keccak256(RELAY_REQUEST_TYPE);

    struct EIP712Domain {
        string name;
        string version;
        uint256 chainId;
        address verifyingContract;
    }

    bytes32 public constant EIP712DOMAIN_TYPEHASH =
        keccak256(
            "EIP712Domain(string name,string version,uint256 chainId,address verifyingContract)"
        );

    function splitRequest(GsnTypes.RelayRequest calldata req)
        internal
        pure
        returns (bytes memory suffixData)
    {
        suffixData = abi.encode(hashRelayData(req.relayData));
    }

    //verify that the recipient trusts the given forwarder
    // MUST be called by paymaster
    function verifyForwarderTrusted(GsnTypes.RelayRequest calldata relayRequest)
        internal
        view
    {
        (bool success, bytes memory ret) = relayRequest.request.to.staticcall(
            abi.encodeWithSelector(
                IRelayRecipient.isTrustedForwarder.selector,
                relayRequest.relayData.forwarder
            )
        );
        require(success, "isTrustedForwarder: reverted");
        require(ret.length == 32, "isTrustedForwarder: bad response");
        require(abi.decode(ret, (bool)), "invalid forwarder for recipient");
    }

    function verifySignature(
        GsnTypes.RelayRequest calldata relayRequest,
        bytes calldata signature
    ) internal view {
        bytes memory suffixData = splitRequest(relayRequest);
        bytes32 _domainSeparator = domainSeparator(
            relayRequest.relayData.forwarder
        );
        IForwarder forwarder = IForwarder(
            payable(relayRequest.relayData.forwarder)
        );
        forwarder.verify(
            relayRequest.request,
            _domainSeparator,
            RELAY_REQUEST_TYPEHASH,
            suffixData,
            signature
        );
    }

    function verify(
        GsnTypes.RelayRequest calldata relayRequest,
        bytes calldata signature
    ) internal view {
        verifyForwarderTrusted(relayRequest);
        verifySignature(relayRequest, signature);
    }

    function execute(
        GsnTypes.RelayRequest calldata relayRequest,
        bytes calldata signature
    )
        internal
        returns (
            bool forwarderSuccess,
            bool callSuccess,
            bytes memory ret
        )
    {
        bytes memory suffixData = splitRequest(relayRequest);
        bytes32 _domainSeparator = domainSeparator(
            relayRequest.relayData.forwarder
        );
        /* solhint-disable-next-line avoid-low-level-calls */
        (forwarderSuccess, ret) = relayRequest.relayData.forwarder.call(
            abi.encodeWithSelector(
                IForwarder.execute.selector,
                relayRequest.request,
                _domainSeparator,
                RELAY_REQUEST_TYPEHASH,
                suffixData,
                signature
            )
        );
        if (forwarderSuccess) {
            //decode return value of execute:
            (callSuccess, ret) = abi.decode(ret, (bool, bytes));
        }
        truncateInPlace(ret);
    }

    //truncate the given parameter (in-place) if its length is above the given maximum length
    // do nothing otherwise.
    //NOTE: solidity warns unless the method is marked "pure", but it DOES modify its parameter.
    function truncateInPlace(bytes memory data) internal pure {
        MinLibBytes.truncateInPlace(data, MAX_RETURN_SIZE);
    }

    function domainSeparator(address forwarder)
        internal
        view
        returns (bytes32)
    {
        return
            hashDomain(
                EIP712Domain({
                    name: "GSN Relayed Transaction",
                    version: "2",
                    chainId: getChainID(),
                    verifyingContract: forwarder
                })
            );
    }

    function getChainID() internal view returns (uint256 id) {
        /* solhint-disable no-inline-assembly */
        assembly {
            id := chainid()
        }
    }

    function hashDomain(EIP712Domain memory req)
        internal
        pure
        returns (bytes32)
    {
        return
            keccak256(
                abi.encode(
                    EIP712DOMAIN_TYPEHASH,
                    keccak256(bytes(req.name)),
                    keccak256(bytes(req.version)),
                    req.chainId,
                    req.verifyingContract
                )
            );
    }

    function hashRelayData(GsnTypes.RelayData calldata req)
        internal
        pure
        returns (bytes32)
    {
        return
            keccak256(
                abi.encode(
                    RELAYDATA_TYPEHASH,
                    req.gasPrice,
                    req.pctRelayFee,
                    req.baseRelayFee,
                    req.relayWorker,
                    req.paymaster,
                    req.forwarder,
                    keccak256(req.paymasterData),
                    req.clientId
                )
            );
    }
}
